import React, { useState } from "react";

const data = [
  { id: 8, name: "OKX Cold Wallet", share: "1.32%", visible: false },
  { id: 9, name: "Binance 14", share: "1.06%", visible: false },
  { id: 10, name: "0x98ad...ba9d", share: "0.94%", visible: true },
  { id: 11, name: "Okx 14", share: "0.77%", visible: false },
  { id: 12, name: "Okx 15", share: "0.77%", visible: false },
  { id: 13, name: "Okx 13", share: "0.77%", visible: false },
  { id: 14, name: "Tether Inventory", share: "0.68%", visible: false }
];

export default function AddressList() {
  const [search, setSearch] = useState("");

  const filteredData = data.filter(item =>
    item.name.toLowerCase().includes(search.toLowerCase())
  );

  return (
    <div className="bg-[#1e1f2c] text-white p-4 rounded-lg shadow-lg w-96">
      {/* Header */}
      <h2 className="text-lg font-bold mb-4">Address List</h2>

      {/* Search */}
      <input
        type="text"
        placeholder="Search"
        value={search}
        onChange={(e) => setSearch(e.target.value)}
        className="w-full p-2 rounded bg-[#2b2c3b] text-white mb-3"
      />

      {/* Filters */}
      <div className="flex gap-3 mb-3 text-sm">
        <label className="flex items-center gap-1">
          <input type="checkbox" className="accent-pink-500" /> Show contracts
        </label>
        <label className="flex items-center gap-1">
          <input type="checkbox" className="accent-pink-500" /> Show exchanges
        </label>
      </div>

      {/* Table */}
      <div className="divide-y divide-gray-700">
        {filteredData.map((item) => (
          <div
            key={item.id}
            className="flex justify-between items-center py-2 text-sm hover:bg-[#2e2f40] rounded transition-colors"
          >
            <div className="flex gap-2 items-center">
              <span className="text-gray-400">#{item.id}</span>
              <span>{item.name}</span>
            </div>
            <div className="font-semibold">{item.share}</div>
          </div>
        ))}
      </div>
    </div>
  );
}
